    accounting_book_help: {
      cs_CZ: "&lt;p&gt;Vyberte účetní knihu, kterou chcete použít k vyhledání shodných řádků transakcí.&lt;/p&gt;&lt;p&gt;Detaily o existujících účetních knihách naleznete v nabídce Nastavení &gt; Účetnictví &gt; Účtování ve více knihách &gt; Účetní knihy.&lt;/p&gt;",
      da_DK: "<p>Vælg den regnskabsbog, som du vil bruge til at søge efter transaktionslinjer, som kan matches.</p><p>For detaljer om eksisterende regnskabsbøger skal du gå til Konfiguration > Regnskabsføring > Regnskab med flere bøger > Regnskabsbøger.</p>",
      de_DE: "<p>Wählen Sie das Geschäftsbuch aus, das Sie verwenden möchten, um nach vergleichbaren Transaktionszeilen zu suchen.</p><p>Für Details zu bestehenden Geschäftsbüchern navigieren Sie zu „Einrichtung > Rechnungswesen > Rechnungswesen mit mehreren Büchern > Geschäftsbücher“.</p>",
      en_US: "<p>Select the accounting book that you want to use to search for matchable transaction lines.</p><p>For details on existing accounting books, go to Setup > Accounting > Multi-Book Accounting > Accounting Books.</p>",
      es_AR: "<p>Seleccione el libro contable que desea usar para buscar líneas de transacciones coincidentes.</p><p>Para obtener información acerca de los libros contables existentes, vaya a Configuración > Contabilidad > Contabilidad en múltiples libros > Libros de contabilidad.</p>",
      es_ES: "<p>Seleccione el libro contable que desea usar para buscar líneas de transacciones coincidentes.</p><p>Para obtener información acerca de los libros contables existentes, vaya a Configuración > Contabilidad > Contabilidad en múltiples libros > Libros de contabilidad.</p>",
      fi_FI: "<p>Valitse kirjanpitokirja, jota haluat käyttää täsmäytettävien kauppatapahtumalinjojen hakemiseen.</p><p>Saat lisätietoja olemassa olevista kirjanpidoista kohdasta Asetukset > Kirjanpito > Monikirjainen kirjanpito > Kirjanpidot.</p>",
      fr_CA: "<p>Sélectionnez le livre comptable que vous souhaitez utiliser pour rechercher les lignes de transactions à rapprocher.</p><p>Pour obtenir plus d’informations détaillées sur les livres comptables existants, accédez à Configuration > Comptabilité > Comptabilité à livres multiples > Livres comptables.</p>",
      fr_FR: "<p>Sélectionnez le livre comptable que vous souhaitez utiliser pour rechercher les lignes de transactions à rapprocher.</p><p>Pour obtenir plus d’informations détaillées sur les livres comptables existants, accédez à Configuration > Comptabilité > Comptabilité à livres multiples > Livres comptables.</p>",
      id_ID: "<p>Pilih buku akuntansi yang ingin Anda gunakan untuk mencari baris transaksi yang cocok.</p><p>Untuk detail mengenai buku akuntansi yang ada, buka Penyiapan > Akuntansi > Akuntansi Multipembukuan > Buku Akuntansi.</p>",
      it_IT: "<p>Selezionare il registro contabile che si desidera usare per le transazioni corrispondenti.</p><p>Per informazioni dettagliate sui registri contabili esistenti, andare a Configurazione > Contabilità > Contabilità multiregistro > Registri contabili.</p>",
      ja_JP: "<p>照合するトランザクション行の検索に使用する会計帳簿を選択します。</p><p>既存の会計帳簿の詳細を確認するには、「設定」 > 「会計」 > 「複数帳簿会計」 > 「会計帳簿」の順に移動します。</p>",
      ko_KR: "<p>매칭 가능한 거래 라인을 검색하는 데 사용할 계정을 선택하십시오.</p><p>기존 회계 장부에 대한 자세한 내용을 보려면 설정 > 다중 장부 회계 > 회계 장부로 이동하십시오.</p>",
      nl_NL: "<p>Selecteer het boekhoudboek dat u wilt gebruiken om naar overeenkomende transactieregels te zoeken.</p><p>Ga voor meer informatie over huidige boekhoudboeken naar Setup > Boekhouding met meerdere boeken > Boekhoudboeken.</p>",
      no_NO: "<p>Velg regnskapsboken du vil bruke for å søke etter avstemmingstransaksjonslinjer.</p><p>Hvis du vil ha detaljert informasjon om eksisterende regnskapsbøker, går du til Oppsett > Regnskap > Flerboksregnskap > Regnskapsbøker.</p>",
      pt_BR: "<p>Selecione o livro contábil que você deseja usar para buscar linhas de transações nas quais é possível fazer o confronto.</p><p>Para obter detalhes sobre livros contábeis existentes, acesse Configuração > Contabilidade > Contabilidade multilivros > Livros contábeis.</p>",
      ru_RU: "<p>Выберите бухгалтерскую книгу, которую нужно использовать для поиска подходящих операций.</p><p>Подробные сведения о бухгалтерских книгах см. в разделе «Настройка» > «Бухучет» > «Бухучет в множестве книг» > «Бухгалтерские книги».</p>",
      sv_SE: "<p>Välj den redovisningsbok du vill använda för att söka efter matchande transaktionsrader.</p><p>Du finner information om existerande redovisningsböcker via Inställningar > Redovisning > Redovisning med flera böcker > Redovisningsböcker.</p>",
      th_TH: "<p>เลือกบัญชีที่คุณต้องการใช้ในการค้นหาธุรกรรมที่จะจับคู่กันได้</p><p>หากต้องการดูรายละเอียดบัญชีให้ไปที่ > ตั้งค่า > การบัญชี > ผังบัญชี</p>",
      tr_TR: "&lt;p&gt;Eşleştirilebilir işlem satırlarını aramak için kullanmak istediğiniz muhasebe defterini seçin.&lt;/p&gt;&lt;p&gt;Mevcut muhasebe defterlerine ilişkin detaylar için Kurulum &gt; Muhasebe &gt; Çok Defterli Muhasebe &gt; Muhasebe Defterleri kısmına gidin.&lt;/p&gt;",
      vi_VN: "<p>Chọn sổ kế toán mà bạn muốn sử dụng để tìm kiếm các dòng giao dịch phù hợp.</p><p>Để biết chi tiết về các sổ kế toán hiện có, hãy vào Thiết lập > Kế toán > Kế toán Đa sổ > Sổ kế toán.</p>",
      zh_CN: "&lt;p&gt;选择要用来搜索可匹配交易行的账簿。&lt;/p&gt;&lt;p&gt;有关现有账簿的详细信息，请转至“设置”&gt;“会计”&gt;“多账簿会计”&gt;“会计账簿”。&lt;/p&gt;",
      zh_TW: "<p>選擇您要用來搜尋可配對交易行的會計帳冊。</p><p>如需帳戶的詳細資訊，請前往「設定」>「會計」>「會計科目表」。</p>"
    },
