    async_error_message: {
      cs_CZ: "Minimálně jeden z vybraných řádků transakce se momentálně zpracovává. Na těchto řádcích transakce nelze provést žádnou akci, dokud proces neskončí. Zkontrolujte jejich stav na dílčí kartě Probíhá párování.",
      da_DK: "En eller flere af de valgte transaktionslinjer behandles i øjeblikket. Du kan ikke udføre nogen handling på disse transaktionslinjer, før processen er fuldført. Tjek deres status på underfanen Matchning i gang.",
      de_DE: "Eine oder mehrere der ausgewählten Transaktionszeilen werden derzeit bearbeitet. Sie können an diesen Transaktionszeilen keine Aktionen durchführen, bevor der Vorgang abgeschlossen ist. Bitte überprüfen Sie ihren Status im Subtab „Übereinstimmung in Arbeit“.",
      en_US: "One or more of the selected transaction lines are currently being processed. You cannot perform any action on these transaction lines until the process is finished. Please check their status in the Matching In Progress subtab.",
      es_AR: "Una o más líneas de transacciones seleccionadas se están procesando. No puede realizar ninguna acción con estas líneas de transacción hasta que finalice el proceso. Verifique sus estados en la subficha Coincidencia en progreso.",
      es_ES: "Una o más líneas de transacciones seleccionadas se están procesando. No puede realizar ninguna acción con estas líneas de transacción hasta que finalice el proceso. Verifique sus estados en la subficha Coincidencia en progreso.",
      fi_FI: "Yhtä tai useampaa valittua kauppatapahtumalinjaa käsitellään parhaillaan. Et voi suorittaa mitään toimintoja näille kauppatapahtumalinjoille ennen prosessin päättymistä. Tarkista niiden tila Täsmäytyksen tarkistaminen käynnissä -välilehdellä.",
      fr_CA: "Une ou plusieurs lignes de transactions sélectionnées sont en cours de traitement. Vous ne pouvez effectuer aucune action sur ces lignes de transactions tant que le traitement n’est pas terminé. Vérifiez leur statut dans le sous-onglet Rapprochement en cours.",
      fr_FR: "Une ou plusieurs lignes de transactions sélectionnées sont en cours de traitement. Vous ne pouvez effectuer aucune action sur ces lignes de transactions tant que le traitement n’est pas terminé. Vérifiez leur statut dans le sous-onglet Rapprochement en cours.",
      id_ID: "Satu atau beberapa baris transaksi yang dipilih saat ini sedan diproses. Anda tidak dapat melakukan tindakan apa pun pada baris transaksi ini sebelum proses tersebut selesai. Periksa statusnya pada subtab Pencocokan Sedang Berlangsung.",
      it_IT: "Una o più righe di transazione selezionate sono attualmente in corso di elaborazione. Non è possibile eseguire alcuna operazione su queste righe di transazione fino al termine del processo. Controllare il rispettivo stato nella sottoscheda Corrispondenza in corso.",
      ja_JP: "選択した1つ以上のトランザクション行が現在処理中です。処理が終了するまで、これらのトランザクション行ではいかなるアクションも実行できません。「処理中の照合」サブタブでステータスをご確認ください。",
      ko_KR: "선택한 거래 중 하나 이상이 현재 처리 중입니다. 처리가 완료될 때까지 이러한 거래 라인에서 작업을 수행할 수 없습니다. 매칭 진행 중 하위 탭에서 상태를 확인하시기 바랍니다.",
      nl_NL: "Eén of meerdere van de geselecteerde transactieregels worden momenteel verwerkt. U kunt geen handelingen verrichten met deze transactieregels tot het verwerken is afgerond. Controleer de status in het subtabblad Overeenkomsten zoeken in uitvoering.",
      no_NO: "En eller flere av de valgte transaksjonslinjene er under behandling. Du kan ikke utføre noen handling på disse transaksjonslinjene før prosessen er fullført. Sjekk statusen deres i Avstemming underveis-underfanen.",
      pt_BR: "Uma ou mais das linhas de transação selecionadas estão sendo processadas no momento. Não será possível realizar nenhuma ação nessas linhas de transação até que o processo seja concluído. Verifique o status na subaba Confronto em andamento.",
      ru_RU: "Идет обработка одной или нескольких выбранных строк операций. До завершения этого процесса невозможно выполнять какие-либо действия с этими строками операций. Проверьте их статус на подвкладке «Выполняется сопоставление».",
      sv_SE: "En eller flera av de valda transaktionsraderna behandlas. Du kan inte utföra några åtgärder på dessa transaktionsrader förrän processen är klar. Kontrollera deras status i underfliken Matchning pågår.",
      th_TH: "บันทึกรายการธุรกรรมที่เลือกหนึ่งรายการขึ้นไปกำลังอยู่ในระหว่างการประมวลผล คุณไม่สามารถดำเนินการใด ๆ กับบันทึกรายการธุรกรรมเหล่านี้ได้จนกว่าการประมวลผลจะแล้วเสร็จ โปรดตรวจสอบสถานะได้ในแท็บย่อย การจับคู่ที่อยู่ในระหว่างการดำเนินการ",
      tr_TR: "Seçilmiş işlem satırlarından bir veya daha fazlası şu anda işleniyor. İşlem bitene kadar bu işlem satırlarında herhangi bir eylem gerçekleştiremezsiniz. Lütfen satırların durumunu Eşleşme Devam Ediyor alt sekmesinden kontrol edin.",
      vi_VN: "Một hoặc nhiều dòng giao dịch được chọn đang được xử lý. Bạn không thể thực hiện bất kì hành động nào trên những dòng giao dịch này cho đến khi quá trình được hoàn thành. Vui lòng kiểm tra trạng thái trong tab phụ So chiếu đang tiến hành.",
      zh_CN: "当前正在处理一个或多个所选交易行。您要到该过程完成之后才能执行对这些交易行的任何操作。请在“正在匹配”子标签中检查其状态。",
      zh_TW: "目前正在處理一項或多項所選的交易行。您無法對這些交易行執行任何動作，直到處理程序完成。請在「進行中的配對」子標籤檢查其狀態。"
    },
