      th_TH: "ยอดเงินรวมของทุกการทำธุรกรรมที่เลือก (เครดิตและเดบิต)/ยอดเงินรวม (เครดิตและเดบิต) ของทุกการทำธุรกรรมเครดิตในผลลัพธ์การค้นหาการจับคู่ GL Matching",
      tr_TR: "Seçilmiş olan tüm işlemlerin toplam bakiyesi (alacak ve borç) / GL Matching arama sonuçlarındaki tüm işlemlerin toplam bakiyesi (alacak ve borç).",
      vi_VN: "Tổng số dư của tất cả các giao dịch (ghi có và ghi nợ) hiện được chọn / Tổng số dư (ghi có và ghi nợ) của tất cả các giao dịch trong các kết quả tìm kiếm GL Matching.",
      zh_CN: "当前选定的所有交易的总余额（贷记和借记）/GL Matching 搜索结果中所有交易的总余额（贷记和借记）。",
      zh_TW: "所有目前所選交易 (貸方記帳和借方入帳) 的餘額總計/「GL Matching」搜尋結果中所有交易的餘額總計 (貸方記帳和借方入帳)。"
