    class_help: {
      cs_CZ: "&lt;p&gt;Pokud chcete vyhledat řádky transakce, které se týkají pouze určité třídy typu účtu, vyberte tuto třídu v seznamu.&lt;/p&gt;&lt;p&gt;Přejděte do nabídky Nastavení &amp;gt; Společnost &amp;gt; Klasifikace &amp;gt; Třídy, kde najdete podrobnosti o stávajících třídách.&lt;/p&gt;",
      da_DK: "<p>Hvis du vil søge efter transaktionslinjer, som kun gælder en bestemt klasse for en kontotype, skal du vælge denne klasse på listen.</p><p>Gå til Konfiguration &gt; Firma &gt; Klassifikationer &gt; Klasser for at se detaljer om eksisterende placeringer.</p>",
      de_DE: "<p>Wenn Sie nach Transaktionszeilen suchen möchten, die nur auf eine bestimmte Klasse einer Kontenart zutreffen, wählen Sie diese Klasse aus der Liste aus.</p><p>Navigieren Sie zu „Einrichtung &gt; Unternehmen &gt; Klassifizierungen &gt; Klassen“, um Details zu bestehenden Klassen einzusehen.</p>",
      en_US: "<p>If you want to search for transaction lines that apply only to a certain class of an account type, select this class from the list.</p><p>Go to Setup &gt; Company &gt; Classifications &gt; Classes for details about existing classes.</p>",
      es_AR: "<p>Si desea buscar líneas de transacción que solo se aplican a una clase de un tipo de cuenta en particular, seleccione esta clase de la lista.</p><p>Vaya a Configuración &gt; Empresa &gt; Clasificaciones &gt; Clases para obtener información acerca de las clases existentes.</p>",
      es_ES: "<p>Si desea buscar líneas de transacción que solo se aplican a una clase de un tipo de cuenta en particular, seleccione esta clase de la lista.</p><p>Vaya a Configuración &gt; Empresa &gt; Clasificaciones &gt; Clases para obtener información acerca de las clases existentes.</p>",
      fi_FI: "<p>Jos haluat hakea kauppatapahtumalinjoja, jotka koskevat vain tiettyä tilin tyypin luokkaa, valitse luokka luettelosta.</p><p>Siirry kohtaan Asetukset &gt; Yritys &gt; Luokitukset &gt; Luokat, niin saat tarkempia tietoja olemassa olevista luokista.</p>",
      fr_CA: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à une catégorie donnée de type de compte, sélectionnez cette catégorie dans la liste.</p><p>Accédez à Configuration &gt; Société &gt; Classifications &gt; Catégories pour obtenir des informations détaillées sur les catégories existantes.</p>",
      fr_FR: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à une catégorie donnée de type de compte, sélectionnez cette catégorie dans la liste.</p><p>Accédez à Configuration &gt; Société &gt; Classifications &gt; Catégories pour obtenir des informations détaillées sur les catégories existantes.</p>",
      id_ID: "<p>Jika Anda ingin mencari baris transaksi yang hanya berlaku untuk kelas tertentu dari suatu jenis rekening, pilih kelas ini dari daftar.</p><p>Buka Penyiapan &gt; Perusahaan &gt; Klasifikasi &gt; Kelas untuk detail tentang kelas yang ada.</p>",
      it_IT: "<p>Se si desidera cercare solo le righe di transazione relative a una data classe o tipo di conto, selezionare la classe dall’elenco.</p><p>Per informazioni dettagliate sulle classi esistenti, scegliere Configurazione &gt; Società &gt; Classificazioni &gt; Classi.</p>",
      ja_JP: "<p>勘定科目の種類の特定の区分にのみ適用されるトランザクション明細を検索する場合は、リストからこの区分を選択します。</p><p>既存の区分の詳細は、 「会社&gt;分類&gt;区分&gt;の設定」 を参照してください。</p>",
      ko_KR: "<p>어떤 계정 유형의 특정 클래스에만 적용할 거래 라인을 검색하려는 경우, 목록에서 해당 클래스를 선택하십시오.</p><p>기존 공급자에 대한 자세한 내용을 보려면 설정 &gt; 회사 &gt; 분류 &gt; 클래스로 이동하십시오.</p>",
      nl_NL: "<p>Als u naar transactieregels wilt zoeken die alleen van toepassing zijn op een bepaalde klasse rekeningtype, selecteer deze klasse dan in de lijst.</p><p>Ga naar Setup &gt; Bedrijf &gt; Classificaties &gt; Klassen voor gegevens over bestaande klassen.</p>",
      no_NO: "<p>Hvis du vil søke etter transaksjonslinjer som bare gjelder for en bestemt kontotypeklasse, velger du denne klassen fra listen.</p><p>Gå til Oppsett &gt; Selskap &gt; Klassifiseringer &gt; Klasser for informasjon om eksisterende klasser.</p>",
      pt_BR: "<p>Se deseja buscar transações que se aplicam apenas a uma determinada classe, selecione-a na lista.</p><p>Acesse Configuração &gt; Empresa &gt; Classificações &gt; Classes para obter detalhes sobre as classes existentes.</p>",
      ru_RU: "<p>Если нужно найти операции, относящиеся к определенному классу типа счета, выберите этот класс в списке.</p><p>Выберите «Настройка» &gt; «Компания» &gt; «Классификации» &gt; «Классы» для просмотра информации о существующих классах.</p>",
      sv_SE: "<p>Om du vill söka efter transaktionsrader som endast gäller en viss kontoklass, välj denna klass från listan.</p><p>Gå till Inställningar &gt; Företag &gt; Klassificeringar &gt; Kategorier för information om befintliga klasser.</p>",
      th_TH: "<p>หากคุณต้องการค้นหาบันทึกรายการธุรกรรมที่ใช้กับบัญชีบางคลาสเท่านั้น ให้เลือกคลาสบัญชีดังกล่าวจากรายการไปยัง</p><p>การตั้งค่า&gt; บริษัท&gt; การแบ่งประเภท&gt; คลาส เพื่อดูรายละเอียดเกี่ยวกับคลาสที่มีอยู่ </p>",
      tr_TR: "&lt;p&gt;Yalnızca belirli bir hesap türü sınıfı için geçerli olan işlem satırlarını aramak istiyorsanız listeden bu sınıfı seçin.&lt;/p&gt;&lt;p&gt;Mevcut sınıflara ilişkin detaylar için Listeler &amp;gt; Sınıflandırmalar &amp;gt; Sınıflar kısmına gidin.&lt;/p&gt;",
      vi_VN: "<p>Nếu bạn muốn tìm kiếm các dòng giao dịch mà chỉ áp dụng cho một lớp loại tài khoản nhất định, hãy chọn lớp đó từ danh sách.</p><p>Vào Thiết lập &gt; Công ty &gt; Phân loại &gt; Lớp để biết thêm thông tin chi tiết về các nhóm hiện tại.</p>",
      zh_CN: "&lt;p&gt;如果要搜索只适用于特定类别的账户类型的交易行，请从列表中选择此类别。&lt;/p&gt;&lt;p&gt;转至“设置”&amp;gt;“公司”&amp;gt;“分类”&amp;gt;“类别”，了解有关现有类别的详细信息。&lt;/p&gt;",
      zh_TW: "<p>如果您想要搜尋僅適用於帳戶類型特定類別的交易行，請從清單中選擇這個類別。</p><p>前往「設定」&gt;「公司」&gt;「分類」&gt;「類別」，以取得現有類別的相關詳細資料。</p>"
    },
