      vi_VN: "Vui lòng bỏ so chiếu nhóm trong tài khoản và công ty con không chứa các dòng giao dịch này. Để biết thêm thông tin về cách bỏ so chiếu nhóm các dòng giao dịch, xem mục ‘Hoàn tác nhóm dòng giao dịch’ của hướng dẫn người dùng.",
      zh_CN: "如果这些交易行不属于账户和附属公司，请取消匹配该组。有关如何取消匹配一组交易行的信息，请参阅用户指南的“撤消一组交易行”一节。",
