    department_help: {
      cs_CZ: "&lt;p&gt;Pokud chcete vyhledat řádky transakce, které se týkají pouze určitého oddělení nebo obchodní oblasti, vyberte toto oddělení v seznamu.&lt;/p&gt;&lt;p&gt;Přejděte do nabídky Nastavení &amp;gt; Společnost &amp;gt; Klasifikace &amp;gt; Oddělení, kde najdete podrobnosti o stávajících odděleních.&lt;/p&gt;",
      da_DK: "<p>Hvis du vil søge efter transaktionslinjer, som kun gælder en bestemt afdeling eller forretningsområde, skal du vælge denne afdeling på listen.</p><p>Gå til Konfiguration &gt; Firma &gt; Klassifikationer </p> Afdelinger for at se detaljer om eksisterende afdelinger.&gt;",
      de_DE: "<p>Wenn Sie nach Transaktionszeilen suchen möchten, die nur auf eine bestimmte Abteilung oder einen bestimmten Geschäftsbereich zutreffen, wählen Sie diese Abteilung aus der Liste aus.</p><p>Navigieren Sie zu „Einrichtung &gt; Unternehmen &gt; Klassifizierungen &gt; Abteilungen“, um Details zu bestehenden Abteilungen einzusehen.</p>",
      en_US: "<p>If you want to search for transaction lines that apply only to a certain department or business area, select this department from the list.</p><p>Go to Setup &gt; Company &gt; Classifications &gt; Departments for details about existing departments.</p>",
      es_AR: "<p>Si desea buscar líneas de transacción que solo se aplican a un departamento o área comercial en particular, seleccione este departamento de la lista.</p><p>Vaya a Configuración &gt; Empresa &gt; Clasificaciones &gt; Departamentos para obtener información acerca de los departamentos existentes.</p>",
      es_ES: "<p>Si desea buscar líneas de transacción que solo se aplican a un departamento o área comercial en particular, seleccione este departamento de la lista.</p><p>Vaya a Configuración &gt; Empresa &gt; Clasificaciones &gt; Departamentos para obtener información acerca de los departamentos existentes.</p>",
      fi_FI: "<p>Jos haluat hakea kauppatapahtumalinjoja, jotka koskevat vain tiettyä osastoa tai liiketoiminnan osaa, valitse osasto luettelosta.</p><p>Siirry kohtaan Asetukset &gt; Yritys &gt; Luokitukset &gt; Osastot, niin saat tarkempia tietoja olemassa olevista osastoista.</p>",
      fr_CA: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à un service ou une unité opérationnelle donné(e), sélectionnez ce service dans la liste.</p><p>Accédez à Configuration &gt; Société &gt; Classifications &gt; Services pour obtenir des informations détaillées sur les services existants.</p>",
      fr_FR: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à un service ou une unité opérationnelle donné(e), sélectionnez ce service dans la liste.</p><p>Accédez à Configuration &gt; Société &gt; Classifications &gt; Services pour obtenir des informations détaillées sur les services existants.</p>",
      id_ID: "<p>Jika Anda ingin mencari baris transaksi yang hanya berlaku untuk departemen atau area bisnis tertentu, pilih departemen ini dari daftar.</p><p>Buka Penyiapan &gt; Perusahaan &gt; Klasifikasi &gt; Departemen untuk detail tentang departemen yang ada.</p>",
      it_IT: "<p>Se si desidera cercare solo le righe di transazione relative a un dato reparto o area aziendale, selezionare il reparto in questione dall’elenco.</p><p>Per informazioni dettagliate sui reparti esistenti, scegliere Configurazione &gt; Società &gt; Classificazioni &gt; Reparti.</p>",
      ja_JP: "<p>特定の部門または業務分野にのみ適用されるトランザクション行を検索する場合は、その部門をリストから選択します。</p><p>既存の部門についての詳細を確認するには、「設定」&gt;「会社」&gt;「分類」&gt;「部門」の順に移動します。</p>",
      ko_KR: "<p>특정 부서나 비즈니스 영역에만 적용할 거래 라인을 검색하려는 경우, 목록에서 해당 부서를 선택하십시오.</p><p>기존 부서에 대한 자세한 내용을 보려면 설정 &gt; 회사 &gt; 분류 &gt; 부서로 이동하십시오.</p>",
      nl_NL: "<p>Als u naar transactieregels wilt zoeken die alleen van toepassing zijn op een bepaalde afdeling of bedrijfsgebied, selecteer deze afdeling dan in de lijst.</p><p>Ga naar Setup &gt; Bedrijf &gt; Classificaties &gt; Afdelingen voor gegevens over bestaande afdelingen.</p>",
      no_NO: "<p>Hvis du vil søke etter transaksjonslinjer som bare gjelder for en bestemt avdeling eller et virksomhetsområde, velg denne avdelingen fra listen.</p><p>Gå til Oppsett &gt; Selskap &gt; Klassifiseringer &gt; Avdelinger for informasjon om eksisterende avdelinger.</p>",
      pt_BR: "<p>Se deseja buscar linhas de transação que se aplicam apenas a uma determinada área comercial ou departamento, selecione-o na lista.</p><p>Acesse Configuração &gt; Empresa &gt; Classificações &gt; Departamentos para obter detalhes sobre os departamentos existentes.</p>",
      ru_RU: "<p>Если нужно найти операции, относящиеся к определенному отделу или направлению бизнеса, выберите этот отдел в списке.</p><p>Выберите «Настройка» &gt; «Компания» &gt; «Классификации» &gt; «Отделы» для просмотра информации о существующих отделах.</p>",
      sv_SE: "<p>Om du vill söka efter transaktionsrader som endast gäller för en viss avdelning eller ett affärsområde väljer du den här avdelningen i listan.</p><p>Gå till Inställningar &gt; Företag &gt; Klassificeringar &gt; Avdelningar för information om befintliga avdelningar.</p>",
      th_TH: "<p>หากคุณต้องการค้นหาบันทึกรายการธุรกรรมที่ใช้กับแผนกบางแผนกหรือพื้นที่ทางธุรกิจบางพื้นที่เท่านั้น ให้เลือกแผนกดังกล่าวจากรายการ</p><p>ไปยังการตั้งค่า &gt; บริษัท &gt; การแบ่งประเภท &gt; แผนก เพื่อดูรายละเอียดเกี่ยวกับแผนกที่มีอยู่</p>",
      tr_TR: "&lt;p&gt;Yalnızca belirli bir departman veya iş alanı için geçerli olan işlem satırlarını aramak istiyorsanız listeden bu departmanı seçin.&lt;/p&gt;&lt;p&gt;Mevcut departmanlara ilişkin detaylar için Kurulum &amp;gt; Şirket &amp;gt; Sınıflandırmalar &amp;gt; Departmanlar kısmına gidin.&lt;/p&gt;",
      vi_VN: "<p>Nếu bạn muốn tìm kiếm các dòng giao dịch mà chỉ áp dụng cho một phòng ban hoặc khu vực kinh doanh nhất định, hãy chọn phòng ban đó từ danh sách.</p><p>Vào Thiết lập &gt; Công ty &gt; Phân loại &gt; Phòng ban để biết thêm thông tin chi tiết về các phòng ban hiện tại.</p>",
      zh_CN: "&lt;p&gt;如果要搜索只适用于特定部门或业务领域的交易行，请从列表中选择此部门。&lt;/p&gt;&lt;p&gt;转至“设置”&amp;gt;“公司”&amp;gt;“分类”&amp;gt;“部门”，了解有关现有部门的详细信息。&lt;/p&gt;",
      zh_TW: "<p>如果您想要搜尋僅適用於特定部門或業務範疇的交易行，請從清單中選擇這個部門。</p><p>前往「設定」&gt;「公司」&gt;「分類」&gt;「部門」，以取得現有部門的相關詳細資料。</p>"
    },
