    employee_help: {
      cs_CZ: "&lt;p&gt;Pokud chcete vyhledat řádky transakce, které se týkají pouze určitého zaměstnance, vyberte tohoto zaměstnance v seznamu.&lt;/p&gt;&lt;p&gt;Přejděte do nabídky Seznamy &amp;gt; Zaměstnanci &amp;gt; Zaměstnanci, kde najdete podrobnosti o stávajících zaměstnancích.&lt;/p&gt;",
      da_DK: "<p>Hvis du vil søge efter transaktionslinjer, som kun gælder en bestemt medarbejder, skal du vælge denne medarbejder på listen.</p><p>Gå til Lister &gt; Medarbejdere &gt; Medarbejdere for at se detaljer om eksisterende medarbejdere.</p>",
      de_DE: "<p>Wenn Sie nach Transaktionszeilen suchen möchten, die nur auf einen bestimmten Angestellten zutreffen, wählen Sie diesen Angestellten aus der Liste aus.</p><p>Navigieren Sie zu „Listen &gt; Angestellte &gt; Angestellte“, um Details zu bestehenden Angestellten einzusehen.</p>",
      en_US: "<p>If you want to search for transaction lines that apply only to a certain employee, select this employee from the list.</p><p>Go to Lists &gt; Employees &gt; Employees for details about existing employees.</p>",
      es_AR: "<p>Si desea buscar líneas de transacción que solo se aplican a un empleado en particular, seleccione este empleado de la lista.</p><p>Vaya a Listas &gt; Empleados &gt; Empleados para obtener información acerca de los empleados existentes.</p>",
      es_ES: "<p>Si desea buscar líneas de transacción que solo se aplican a un empleado en particular, seleccione este empleado de la lista.</p><p>Vaya a Listas &gt; Empleados &gt; Empleados para obtener información acerca de los empleados existentes.</p>",
      fi_FI: "<p>Jos haluat hakea kauppatapahtumalinjoja, jotka koskevat vain tiettyä työntekijää, valitse työntekijä luettelosta.</p><p>Siirry kohtaan Luettelot &gt; Työntekijät &gt; Työntekijät, niin saat tarkempia tietoja olemassa olevista työntekijöistä.</p>",
      fr_CA: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à un employé donné, sélectionnez cet employé dans la liste.</p><p>Accédez à Listes &gt; Employés &gt; Employés pour obtenir des informations détaillées sur les employés existants.</p>",
      fr_FR: "<p>Si vous souhaitez rechercher des lignes de transactions qui ne s’appliquent qu’à un employé donné, sélectionnez cet employé dans la liste.</p><p>Accédez à Listes &gt; Employés &gt; Employés pour obtenir des informations détaillées sur les employés existants.</p>",
      id_ID: "<p>Jika Anda ingin mencari baris transaksi yang hanya berlaku untuk karyawan tertentu, pilih karyawan ini dari daftar.</p><p>Buka Daftar &gt; Karyawan &gt; Karyawan untuk detail tentang karyawan yang ada.</p>",
      it_IT: "<p>Se si desidera cercare solo le righe di transazione relative a un dato dipendente, selezionarlo dall’elenco.</p><p>Per informazioni dettagliate sui dipendenti esistenti, scegliere Elenchi &gt; Relazioni &gt; Dipendenti.</p>",
      ja_JP: "<p>特定の従業員にのみ適用されるトランザクション行を検索する場合は、その従業員をリストから選択します。</p><p>既存の従業員についての詳細を確認するには、「リスト」&gt;「従業員」&gt;「従業員」の順に移動します。</p>",
      ko_KR: "<p>특정 직원에만 적용할 거래 라인을 검색하려는 경우, 목록에서 해당 직원을 선택하십시오.</p><p>기존 직원에 대한 자세한 내용을 보려면 목록 &gt; 직원 &gt; 직원으로 이동하십시오.</p>",
      nl_NL: "<p>Als u naar transactieregels wilt zoeken die alleen van toepassing zijn op een bepaalde medewerker, selecteer deze medewerker dan in de lijst.</p><p>Ga naar Lijsten &gt; Medewerkers &gt; Medewerkers voor gegevens over bestaande medewerkers.</p>",
      no_NO: "<p>Hvis du vil søke etter transaksjonslinjer som bare gjelder for en bestemt ansatt, velger du denne ansatte fra listen.</p><p>Gå til Lister &gt; Ansatte &gt; Ansatte for informasjon om eksisterende ansatte.</p>",
      pt_BR: "<p>Se deseja buscar linhas de transação que se aplicam apenas a um determinado funcionário, selecione-o na lista.</p><p>Acesse Listas &gt; Funcionários &gt; Funcionários para obter detalhes sobre funcionários existentes.</p>",
      ru_RU: "<p>Если нужно найти операции, относящиеся к определенному сотруднику, выберите этого сотрудника в списке.</p><p>Выберите «Списки» &gt; «Сотрудники» &gt; «Сотрудники» для просмотра информации о существующих сотрудниках.</p>",
      sv_SE: "<p>Om du vill söka efter transaktionsrader som endast gäller en viss anställd, välj den här anställda från listan.</p><p>Gå till Listor &gt; Anställda &gt; Anställda för information om befintliga anställda.</p>",
      th_TH: "<p>หากคุณต้องการค้นหาบันทึกรายการธุรกรรมที่ใช้กับพนักงานบางรายเท่านั้น ให้เลือกพนักงานรายดังกล่าวจากรายการ</p><p>ไปยังรายการ &gt; พนักงาน &gt; พนักงาน เพื่อดูรายละเอียดเกี่ยวกับพนักงานที่มีอยู่</p>",
      tr_TR: "&lt;p&gt;Yalnızca belirli bir çalışan için geçerli olan işlem satırlarını aramak istiyorsanız listeden bu çalışanı seçin.&lt;/p&gt;&lt;p&gt;Mevcut çalışanlara ilişkin detaylar için Listeler &amp;gt; Çalışanlar &amp;gt; Çalışanlar kısmına gidin.&lt;/p&gt;",
      vi_VN: "<p>Nếu bạn muốn tìm kiếm các dòng giao dịch mà chỉ áp dụng cho một nhân viên nhất định, hãy chọn nhân viên đó từ danh sách.</p><p>Vào Danh sách &gt; Nhân viên&gt; để biết thêm thông tin chi tiết về các nhân viên hiện tại.</p>",
      zh_CN: "&lt;p&gt;如果要搜索只适用于特定雇员的交易行，请从列表中选择此雇员。&lt;/p&gt;&lt;p&gt;转至“列表”&amp;gt;“雇员”&amp;gt;“雇员”，了解有关现有雇员的详细信息。&lt;/p&gt;",
      zh_TW: "<p>如果您想要搜尋僅適用於特定員工的交易行，請從清單中選擇這個員工。</p><p>前往「清單」&gt;「員工」&gt;「員工」，以取得現有員工的相關詳細資料。</p>"
    },
