    memo_help: {
      cs_CZ: "Toto pole použijte, pokud chcete hledat transakce podle poznámky. Poznámka je krátký text popisující transakci. V některých zemích (například ve Francii) jsou poznámky povinné u každé transakce a nelze je vynechat.",
      da_DK: "Brug dette felt, hvis du vil søge efter transaktioner på baggrund af deres memo. Et memo er en kort tekst, som beskriver en transaktion. I visse lande (som Frankrig) er memoer obligatoriske for alle transaktioner og kan ikke udelades.",
      de_DE: "Verwenden Sie dieses Datenfeld, wenn Sie basierend auf deren Vermerk nach Transaktionen suchen möchten. Bei einem Vermerk handelt es sich um einen kurzen Text, der eine Transaktion beschreibt. In manchen Ländern (wie Frankreich) sind Vermerke bei jeder Transaktion zwingend notwendig und können nicht weggelassen werden.",
      en_US: "Use this field if you want to search for transactions based on their memo. A memo is a short text describing a transaction. In some countries (like France), memos are mandatory for every transaction and cannot be left out.",
      es_AR: "Use este campo si desea buscar transacciones en función de su nota. Una nota es un texto breve que describe una transacción. En algunos países (como Francia), las notas son obligatorias para cada transacción y no se pueden omitir.",
      es_ES: "Use este campo si desea buscar transacciones en función de su nota. Una nota es un texto breve que describe una transacción. En algunos países (como Francia), las notas son obligatorias para cada transacción y no se pueden omitir.",
      fi_FI: "Käytä tätä kenttää, jos haluat hakea kauppatapahtumia niiden muistion perusteella. Muistio on lyhyt teksti, joka kuvaa kauppatapahtumaa. Joissain maissa (kuten Ranskassa) muistiot ovat pakollisia kaikkien kauppatapahtumien tapauksessa, eikä niitä voi jättää pois.",
      fr_CA: "Utilisez ce champ si vous souhaitez rechercher des transactions en fonction de leur mémo. Un mémo est un texte court décrivant une transaction. Dans certains pays, notamment en France, les mémos sont obligatoires pour toutes les transactions et ne peuvent pas être omis.",
      fr_FR: "Utilisez ce champ si vous souhaitez rechercher des transactions en fonction de leur mémo. Un mémo est un texte court décrivant une transaction. Dans certains pays, notamment en France, les mémos sont obligatoires pour toutes les transactions et ne peuvent pas être omis.",
      id_ID: "Gunakan bidang ini jika Anda ingin mencari transaksi berdasarkan memonya. Memo adalah sebuah teks pendek yang menggambarkan transaksi. Di beberapa negara (seperti Prancis), memo bersifat wajib untuk setiap transaksi dan tidak boleh dilewatkan.",
      it_IT: "Utilizzare questo campo per ricercare le transazioni in base al promemoria. Il promemoria è un breve testo descrittivo della transazione. In alcuni paesi, come per esempio la Francia, è obbligatorio inserire un promemoria per ogni transazione.",
      ja_JP: "メモに基づいてトランザクションを検索する場合は、このフィールドを使用します。メモは、トランザクションを説明する短いテキストです。一部の国（フランスなど）では、メモはすべてのトランザクションで必須のため、省略できません。",
      ko_KR: "메모를 기반으로 거래를 검색하려는 경우 이 필드를 사용하십시오. 메모는 거래를 설명하는 짧은 텍스트입니다. 일부 국가(예: 프랑스)에서 메모는 모든 거래의 필수 항목이며 제외할 수 없습니다.",
      nl_NL: "Gebruik dit veld als u naar transacties wilt zoeken op basis van de memo ervan. Een memo is een korte tekst die een transactie beschrijft. In sommige landen (zoals Frankrijk) zijn memo's voor elke transactie verplicht en kunnen niet worden weggelaten.",
      no_NO: "Bruk dette feltet hvis du vil søke etter transaksjoner basert på merknadene deres. En merknad er en kort tekst som beskriver en transaksjon. I enkelte land (som Frankrike) er merknader obligatoriske for hver transaksjon og kan ikke utelukkes.",
      pt_BR: "Use este campo para buscar transações com base na nota delas. Uma nota é um texto curto que descreve uma transação. Em alguns países (como a França), as notas são obrigatórias para cada transação e não podem ser omitidas.",
      ru_RU: "Используйте это поле, чтобы искать операции по их заметкам. Заметка — это короткий текст, описывающий операцию. В некоторых странах (например, во Франции) заметки являются обязательными для каждой операции.",
      sv_SE: "Använd detta fält om du vill söka efter transaktioner utifrån deras meddelande. Ett meddelande är en kort text som beskriver transaktionen. I vissa länder (som Frankrike) är dessa meddelanden obligatoriska för varje transaktion och får inte utelämnas.",
      th_TH: "ใช้ช่องนี้หากคุณต้องการค้นหาธุรกรรมโดยอ้างอิงตามบันทึกของธุรกรรม บันทึกเป็นข้อความสั้น ๆ ที่อธิบายถึงธุรกรรม ในบางประเทศ (เช่น ฝรั่งเศส) จะต้องมีบันทึกสำหรับทุกธุรกรรมและไม่สามารถเว้นว่างไว้",
      tr_TR: "İşlemleri kendi notlarına göre aramak istiyorsanız bu alanı kullanın. Not, bir işlemi açıklayan kısa metindir. Bazı ülkelerde (Fransa gibi), not her işlem için zorunludur ve ihmal edilemez.",
      vi_VN: "Sử dụng trường này nếu bạn muốn tìm kiếm các giao dịch dựa trên bản ghi nhớ của chúng. Bản ghi nhớ là một đoạn văn bản ngắn mô tả giao dịch. Ở một số quốc gia (như Pháp), bản ghi nhớ là bắt buộc cho mọi giao dịch và không thể bỏ qua.",
      zh_CN: "如果要基于交易的备忘录搜索交易，请使用此字段。备忘录是描述交易的简短文本。在某些国家/地区（如法国），备忘录对于每笔交易是必填的，并且不可遗漏。",
      zh_TW: "如果您想要根據交易的備忘錄進行搜尋，請使用此欄位。備忘錄是說明交易的簡短文字。在某些國家/地區 (例如法國) 中，備忘錄對於每個交易都是必要的，而且不能遺漏。"
    },
