    vendor_help: {
      cs_CZ: "&lt;p&gt;Pokud chcete vyhledat transakce, které se týkají pouze konkrétního dodavatele, vyberte tohoto dodavatele v seznamu.&lt;/p&gt;&lt;p&gt;Přejděte do nabídky Seznamy &amp;gt; Vztahy &amp;gt; Dodavatelé, kde najdete podrobnosti o stávajících zákaznících.&lt;/p&gt;",
      da_DK: "<p>Hvis du vil søge efter transaktioner, som kun gælder for en specifik leverandør, skal du vælge denne leverandør på listen.</p><p>Gå til Lister &gt; Forhold &gt; Leverandører for at se detaljer om eksisterende leverandører.</p>",
      de_DE: "<p>Wenn Sie nach Transaktionen suchen möchten, die nur auf einen bestimmten Lieferanten zutreffen, wählen Sie diesen Lieferanten aus der Liste aus.</p><p>Navigieren Sie zu „Listen &gt; Beziehungen &gt; Lieferanten“, um Details zu bestehenden Lieferanten einzusehen.</p>",
      en_US: "<p>If you want to search for transactions that only apply to a certain vendor, select this vendor from the list.</p><p>Go to Lists &gt; Relationships &gt; Vendors for details about existing vendors.</p>",
      es_AR: "<p>Si desea buscar transacciones que solo se aplican a un proveedor en particular, seleccione este proveedor de la lista.</p><p>Vaya a Listas &gt; Relaciones &gt; Proveedores para obtener información acerca de los proveedores existentes.</p>",
      es_ES: "<p>Si desea buscar transacciones que solo se aplican a un proveedor en particular, seleccione este proveedor de la lista.</p><p>Vaya a Listas &gt; Relaciones &gt; Proveedores para obtener información acerca de los proveedores existentes.</p>",
      fi_FI: "<p>Jos haluat hakea kauppatapahtumia, jotka koskevat vain tiettyä myyjää, valitse myyjä luettelosta.</p><p>Siirry kohtaan Luettelot &gt; Suhteet &gt; Myyjät, niin saat tarkempia tietoja olemassa olevista myyjistä.</p>",
      fr_CA: "<p>Si vous souhaitez rechercher des transactions qui ne s’appliquent qu’à un fournisseur donné, sélectionnez ce fournisseur dans la liste.</p><p>Accédez à Listes &gt; Relations &gt; Fournisseurs pour obtenir des informations détaillées sur les fournisseurs existants.</p>",
      fr_FR: "<p>Si vous souhaitez rechercher des transactions qui ne s’appliquent qu’à un fournisseur donné, sélectionnez ce fournisseur dans la liste.</p><p>Accédez à Listes &gt; Relations &gt; Fournisseurs pour obtenir des informations détaillées sur les fournisseurs existants.</p>",
      id_ID: "<p>Jika Anda ingin mencari transaksi yang hanya berlaku untuk vendor tertentu, pilih vendor ini dari daftar.</p><p>Buka Daftar &gt; Hubungan &gt; Vendor untuk melihat detail tentang vendor yang ada.</p>",
      it_IT: "<p>Se si desidera cercare solo le transazioni relative a un dato fornitore, selezionarlo dall’elenco.</p><p>Per informazioni dettagliate sui fornitori esistenti, scegliere Elenchi &gt; Relazioni &gt; Fornitori.</p>",
      ja_JP: "<p>特定の仕入先にのみ適用されるトランザクションを検索する場合は、リストからその仕入先を選択します。</p><p>既存の仕入先についての詳細を確認するには、「リスト」&gt;「関係」&gt;「仕入先」の順に移動します。</p>",
      ko_KR: "<p>특정 공급자에만 적용할 거래를 검색하려는 경우, 목록에서 해당 공급자를 선택하십시오.</p><p>기존 공급자에 대한 자세한 내용을 보려면 목록 &gt; 관계 &gt; 공급자로 이동하십시오.</p>",
      nl_NL: "<p>Als u naar transacties wilt zoeken die alleen van toepassing zijn op een bepaalde leverancier, selecteer deze leverancier dan in de lijst.</p><p>Ga naar Lijsten &gt; Relaties &gt; Leveranciers voor gegevens over bestaande leveranciers.</p>",
      no_NO: "<p>Hvis du vil søke etter transaksjoner som bare gjelder for en bestemt leverandør, velger du denne leverandøren fra listen.</p><p>Gå til Lister &gt; Forbindelser &gt; Leverandører for informasjon om eksisterende leverandører.</p>",
      pt_BR: "<p>Se deseja buscar transações que se aplicam apenas a um determinado fornecedor, selecione-o na lista.</p><p>Acesse Listas &gt; Relacionamentos &gt; Fornecedores para obter detalhes sobre os fornecedores existentes.</p>",
      ru_RU: "<p>Если нужно найти операции, относящиеся к определенному поставщику, выберите этого поставщика в списке.</p><p>Выберите «Списки» &gt; «Отношения» &gt; «Поставщики» для просмотра информации о существующих поставщиках.</p>",
      sv_SE: "<p>Om du vill söka efter transaktioner som endast gäller en viss leverantör, välj den här leverantören från listan.</p><p>Gå till Listor &gt; Förhållanden &gt; Leverantör för information om befintliga leverantörer.</p>",
      th_TH: "<p>หากคุณต้องการค้นหาการทำธุรกรรมที่ใช้กับผู้ขายบางรายเท่านั้น ให้เลือกผู้ขายรายดังกล่าวจากรายการ</p><p>ไปยังรายการ &gt; ความสัมพันธ์ &gt; ผู้ขาย เพื่อดูรายละเอียดเกี่ยวกับผู้ขายที่มีอยู่</p>",
      tr_TR: "&lt;p&gt;Yalnızca belirli bir satıcı için geçerli olan işlemleri aramak istiyorsanız, listeden bu satıcıyı seçin.&lt;/p&gt;&lt;p&gt;Mevcut satıcılara ilişkin detaylar için Listeler &amp;gt; İlişkiler &amp;gt; Satıcılar kısmına gidin.&lt;/p&gt;",
      vi_VN: "<p>Nếu bạn muốn tìm kiếm các giao dịch mà chỉ áp dụng cho một nhà cung cấp nhất định, hãy chọn nhà cung cấp đó từ danh sách.</p><p>Vào Danh sách &gt; Các mối quan hệ &gt; Nhà cung cấp để biết thêm thông tin chi tiết về các nhà cung cấp hiện tại.</p>",
      zh_CN: "&lt;p&gt;如果要搜索只适用于特定供应商的交易，请从列表中选择此供应商。&lt;/p&gt;&lt;p&gt;转至“列表”&amp;gt;“关系”&amp;gt;“供应商”，了解有关现有供应商的详细信息。&lt;/p&gt;",
      zh_TW: "<p>如果您想要搜尋僅適用於特定廠商的交易，請從清單中選擇這個供貨商。</p><p>前往「清單」&gt;「關係」&gt;「供貨商」，以取得現有廠商的相關詳細資料。</p>"
    },
